import React from "react";
import logo from "./image/images.jpeg"
const Header = () => {
  return (
    <>
      <div className="bg-yellow-400 min-h-[10%]">
      <img src={logo} className="h-12 mb-5 ml-5 mt-5 inline-block"/>
        <h1 className="inline-block"> Hello </h1>
      </div>
    </>
  );
};

export default Header;
